        // }, []);
        this.applications.sort((a, b) => (a["name"] || "").toString().localeCompare((b["name"] || "").toString(), 'en', {
          numeric: false
        })).sort((a, b) => (a["groupName"] || "").toString().localeCompare((b["groupName"] || "").toString(), 'en', {
          numeric: false
        }));
        this.multiApplications.sort((a, b) => (a["name"] || "").toString().localeCompare((b["name"] || "").toString(), 'en', {
